// import { FaPatreon } from "react-icons/fa";

const ParallaxContent = [
    {
        // Homepage
        id: 0,
        Header: 'Thank You To All My Fans for the Love and Support!',
        Paragraph: "Since November of 2019, I have been dedicated to bringing you comedy and great content! I could have never imagined I would grow so big. In less than a year I went from being a failed Youtuber to Hugely Successful TikToker and I can't be more greatful for your love and support! So while your here make sure to sign up for my next gaming event! First come first serve!",
        ButtonText: 'Sign Up ',
        // ButtonIcon: <FaPatreon/>
    },
    {
        // About Page
        id: 1,
        Header: 'Thank You To All My Fans for the Love and Support!',
        Paragraph: 'Since November of 2019, I have been dedicated to bringing you comedy and great content! I could have never imagined I would grow so big. However in September of 2020 I have been hit with what seems like a permanant shadowban on my main account. However I have not stopped bringing you the best content and livestreams as possible and extremely look forward to continuely Entertaining all of you. Make sure to Subscribe to my Email List to get special offers, as well as my Podcast.',
        ButtonText: 'Join Now ',
        // ButtonIcon: <FaPatreon/>
    }
]

export default ParallaxContent
